import React from 'react'
import Post from './Post'

function PostList({ posts }) {
  return (
    <div>{posts.map((post) => (
      <li key={post.id}>
      <h3>{post.title}</h3>
      <p>{post.body}</p>
  </li>
    ))}</div>
  )
}

export default PostList
